helmCharts:
- name: vmc
  includeCRDs: false
  valuesInline:
    installAttemptsLimit: 1
    fullnameOverride: cluster-mx76p
    baseDomain: mx76p.dynamic.opentlc.com
    imageSetRef: img4.12.23-x86-64-appsub
    vsphere:
      vCenter: portal.vc.opentlc.com
      cluster: /SDDC-Datacenter/host/Cluster-1
      datacenter: SDDC-Datacenter
      defaultDatastore: /SDDC-Datacenter/datastore/WorkloadDatastore
      network: segment-sandbox-mx76p
      folder: /SDDC-Datacenter/vm/Workloads/sandbox-mx76p
    sealedSecrets:
      installConfig: 
      dockerconfigjson: 
      sshPrivatekey: 
      caCert: 
      vsphereUsername: 
      vspherePassword: 
  version: 0.0.1
  releaseName: argocd
  repo: https://eformat.github.io/helm-charts
